var selector = document.getElementById("orbit_num");
var orbit = '1';
var NUMORBITS = 12;

function png_url(orb, camera){ // Converts '2' to '02', '10' to '10', etc. 
  var o = '';
  wispr_url = "https://wispr.nrl.navy.mil/data/rel/pngs/PNGs_Orbit"
  if (parseInt(orb) < 10){
    o = '0'+parseInt(orb).toString();
  } else{
    o = parseInt(orb).toString();
  }
  if (parseInt(orb)==5){
    return wispr_url + o + '_' + camera + '_Encounter/';
  } else{
    return wispr_url + o + '_' + camera + '/';
  }
}

